import Link from 'next/link';

const Aside = () => {
    return (
        <div style={sideBarWidth}>
            <aside>
                <Link href="/">
                    <a style={linkStyle}>Home</a>
                </Link>
                <Link href="/about">
                    <a style={linkStyle}>About</a>
                </Link>
            </aside>
            <footer>
                <div>Copyright Next App</div>
            </footer>
        </div>
    );
}

const linkStyle = {
    display: 'block',
}
const sideBarWidth = {
    width: '30%',
}

export default Aside;
